class test {
    fun sortByHouse(records: List<RecordDto>) {
        val sorted = records.sortedBy { record ->
            val houseNumber = record.houseNumber
            val numericPart = houseNumber.split("\\D+".toRegex() )[0].filter { it.isDigit() }
            if (numericPart.isNotEmpty()) {
                numericPart.toInt()
            } else {
                Int.MAX_VALUE
            }
        }
    }
}

